import * as React from "react";
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";

function Header() {
  const [headertitleglobal, setHeaderTitle] = React.useState("");

  React.useEffect(() => {
    import("./SideNav").then((module) => {
      setHeaderTitle(module.headertitleglobal);
    });
  }, []);

  return (
    <AppBar position="static" className="header">
      <Toolbar>
        <Typography
          className="headertext"
          variant="h6"
          component="div"
          sx={{ flexGrow: 1 }}
        >
          {headertitleglobal}
        </Typography>
      </Toolbar>
    </AppBar>
  );
}

export default Header;
